import "./App.css";

function App() {
  return (
    <div className="app">
      <div className="bg">
        <span>
          <span className="headtext">UPBEAT</span>
        </span>
        <div class="text">CLICK ON HERE TO START</div>
      </div>
    </div>
  );
}

export default App;
